import RideHistory from "./RideHistory";
import Payment from "./Payment";
import Profile from "./Profile";

function Home() {
    return (
        <>
        <Navbar />
        <div className='Home'>
            <h1>Home</h1>
        </div>
        </>
    );
}

export default Home;
